func FindAdverseEventContributingVactor(filter string) []AdverseEventContributingVactor {
	ret := make([]AdverseEventContributingVactor, 0)
	for _, at := range AllAdverseEventContributingVactor() {
		if strings.ToLower(at.String())[0:len(filter)] == strings.ToLower(filter) {
			ret = append(ret, at)
		}
	}
	return ret
}

